text869474.addInnerText('<div id=\"text869474\" aria-live=\"polite\" ><a id=\"text869474anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<p lang=\"en\"  legLH=\"1.400\" style=\"margin-left:0px;text-indent:0px;line-height:1.350;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text869474Font2\"  >There are a series of videos within this course. On the Defence Virtual Environment the audio can often be very quiet by default.\n</span ></p >\n<p  legLH=\"1.400\" style=\"margin-left:0px;text-indent:0px;line-height:1.350;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text869474Font2\"  >To resolve this issue try these three steps.\n</span ></p >\n<ol  start=\"1\" style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text869474Font2\" style=\"line-height:1.400;position:relative;padding-left:10px;list-style-type:decimal;margin-left:24px;margin-top:0px;margin-bottom:0px;\"><span class=\"text869474Font2\"  >&nbsp;Turn the volume in the video right up.\n</span ></li >\n<li  class=\"text869474Font2\" style=\"line-height:1.400;position:relative;padding-left:10px;list-style-type:decimal;margin-left:24px;margin-top:0px;margin-bottom:0px;\"><span class=\"text869474Font2\"  >Turn the system volume on your computer up to 100. You can do this by clicking the little speaker symbol in the bottom right of the screen.\n</span ></li >\n<li  class=\"text869474Font2\" style=\"line-height:1.400;position:relative;padding-left:10px;list-style-type:decimal;margin-left:24px;margin-top:0px;margin-bottom:0px;\"><span class=\"text869474Font2\"  >If you are using headphones make sure the headphones volume dial is also set to the highest possible.\n</span ></li >\n</ol >\n<p  legLH=\"1.400\" style=\"margin-left:0px;text-indent:0px;line-height:1.350;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text869474Font2\" style=\"background-color:transparent\" >\n&nbsp;</span ></p >\n<p  style=\"margin-left:0px;text-indent:0px;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text869474Font2\"  >If you continue to have trouble with the videos in the course. You can download the videos via the links above.\n</span ></p >\n</div>\n');
